import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Navigate, useNavigate } from 'react-router-dom';
import Home from './Pages/Home';
import Trivia1 from './Pages/Trivia1';
import Profile from './Pages/Profile';
import SignUp from './Pages/Auth';
import Explore from './Pages/Explore';
import Calendar from './Pages/Calendar';
import CalendarCreation from './Pages/Create-Calendar';
import Signup2 from './Pages/Signup';

function App() {
  const [user, setUser] = useState(null);
  // const history=useNavigate();

  useEffect(() => {
    // Log "signed out" when the component mounts and user is not signed in
    if (!user) {
      console.log("User signed out");
      // history("/home");
    }
  }, [user]);

  const handleSignIn = (userData) => {
    if (userData && Object.keys(userData).length > 0) {
      setUser(userData);
      console.log("User logged in:", userData);
    } else {
      console.log("User not logged in");
    }
  };

  const handleSignOut = () => {
    // Perform any necessary cleanup or logout actions
    setUser(null);
    console.log("User logged out");
  };

  return (
    <Router>
      <div className='web-width-dt'>
        <nav className='head-nav'>
          <Link to="/home">
            <p className='logo'>&#9775;</p>
          </Link>
          <ul className='nav-links'>

              <>
                <li>
                  <Link to="/events">Events</Link>
                </li>

                <li>
                  <Link id="second-middle" to="/explore">Explore</Link>
                </li>

                <li>
                  <Link id="second-middle" to="/calendar">Calendar</Link>
                </li>
                <li>
                  <Link id="middle" to="/profile">Profile</Link>
                </li>
                {/* <li onClick={handleSignOut}>Sign Out</li> */}
              </>

              <li>
                <Link to="/auth">Signup</Link>
              </li>

          </ul>
        </nav>

        <Routes>
          <Route path="/home" element={<Home />} />
          <Route
            path="/events"
            element={<Trivia1 />}
          />
          <Route
            path="/profile"
            element={<Profile />}
          />
          <Route path="/auth" element={<SignUp onSignIn={handleSignIn} />} />
          <Route path="/signup" element={<Signup2 />} />
          <Route path="/calendar" element={<Calendar />} />
          <Route path="/create-calendar" element={<CalendarCreation />} />
          <Route path='/explore' element={<Explore />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
